import React, { useState } from "react";
import { useRouter } from "next/router";
import Typography from "@material-ui/core/Typography";
import { MainBar } from "../../components/MainBar";
import { NavStats } from "../../components/NavStats";
import { GameTable } from "../../components/GameTable";
import { Game, Players, ServeTeam } from "../../types";

export default function Stats() {
  const router = useRouter();
  const { groupname } = router.query;
  const handleDelete = () => {
    console.log("Delete this game from the server.");
  };

  const handleAdd = () => {
    console.log("Add Game");
  };

  const tab1 = <Typography>{groupname}</Typography>;

  // For testing
  const players: Players = new Map([
    [0, "Raphael"],
    [1, "Alex"],
    [2, "Valentin"],
    [3, "Sonam"],
  ]);

  const exampleGames: Game[] = [
    {
      id: 0,
      blueTeam: [0, 3],
      redTeam: [1, 2],
      score: [21, 17],
      serve: ServeTeam.Blue,
      date: new Date(),
    },
    {
      id: 1,
      blueTeam: [0, 1],
      redTeam: [3, 2],
      score: [10, 21],
      serve: ServeTeam.Red,
      date: new Date(),
    },
  ];
  const [games, setGames] = useState(exampleGames);
  const tab2 = (
    <GameTable onDelete={handleDelete} games={games} players={players} />
  );

  return (
    <React.Fragment>
      <MainBar />
      <NavStats tab1Content={tab1} tab2Content={tab2} onAdd={handleAdd} />
    </React.Fragment>
  );
}
